records.addlTxt:
Defendant in custody on WRIT.
The State files an Amended Information which charges 1 count 4th degree sexual assault, contrary to Section 940.225(3m); 1 count criminal trespass to dwelling as repeater, contrary to Sections 943.14 and 939.62(1)(a) and 1 count disorderly conduct as repeater, contrary to Sections 947.01(1) and 939.62(1)(a).
NO CONTEST plea entered to count 1, 4th degree sexual assault.  Convicted.
The State moves to delete the repeater enhancer on count 2.  Motion granted.
NO CONTEST plea entered to count 2, criminal trespass to dwelling.  Convicted.
The State moves to dismiss and read in count 3, disorderly conduct.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for one (1) year, consecutive to the confinement time the defendant is presently serving on case no: 11 CF 197 and 08 CF 172.
Conditions of probation:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) No contact with C.A.Y., DOB: 09-19-1972, her residence or any residence she occupies;
3) Maintain fulltime employment or job search;
4) Maintain absolute sobriety;
5) Pay court costs;
6) pay supervision fees in an amount to be determined by DOC.
The Court explains to the defendant that the Department of Corrections may say that this sentence must be consecutive to the extended supervision time instead of the confinement time and if so, then this probation would not begin until he has completed his extended supervision period on the cases listed above.  The defendant states he understands this.
Minutes.
